        super(props);
        this.state = {
            StateString: 'react'
        }
    }

    shouldComponentUpdate(nextProps, nextState){
        return !ShallowEqualArrays(this.state, nextState);
    }

    componentDidMount(){
        const object = {react: '200'};
        const Array1 = ['리액트', object];
        const Array2 = ['리액트', object];
        const Array3 = ['리액트', {react: '200'}];

        console.log('1. '+ShallowEqualArrays(Array1, Array2));
        console.log('2. '+ShallowEqualArrays(Array2, Array3));

        this.setState({StateString : 'react'})
    }

